function isLessThan(stackA,stackB,index){
  if(index >= stackA.length) return false;
  if(index >= stackB.length) return true;
  
  let a = stackA[index];
  let b = stackB[index];
  if(a !== b){
    
  }
  if(a.charAt(0) === b.charAt(0)){
      // console.log(`tie between ${a} and ${b}`);
      return isLessThan(stackA,stackB, index+1)
  }
  // console.log(`${a} is less than ${b} => ${a.charAt(0) < b.charAt(0)}`);
  return a.charAt(0) < b.charAt(0);
}


